description:
Actiunea se petrece in satul Fierbinti, acolo unde existenta locuitorilor se
desfasoara lent, intr-un paradis rural care s-a adaptat, in stil pur romanesc,
la vremurile moderne. Viceprimarul Vasile vrea sa ii ia locul actualului primar
si se bazeaza pe sprijinul carciumarului Bobita si al prietenului acestuia,
Giani, smecherasul tipic de provincie. Celentano, Firicel a lu' Cimpoaie,
Ardiles si Mos Peleus, betivii satului, sunt aparitii colorate si pline de
umor.
